        //前端保存
        function ToBase64() {
            var ctl = document.getElementById("myWriterControl")
            var options = {
                FileFormat: 'xml', // 生成文档的格式
                commitusertraces: false, // 是否生成提交所有文档痕迹后的内容
                outputformatxml: true // 是否输出带格式的XML
            }
            var a = ctl.SaveDocumentToBase64String(options)
            console.log(a)
        }
        //前端保存pdf
        function Topdfbyflis() {
            var str = ctl.SaveDocumentToBase64String({ FileFormat: "pdf" });
            str = "data:application/pdf;base64," + str;
            var embed = document.createElement("embed");
            embed.setAttribute("src", str);
            embed.setAttribute("type", "application/pdf");
            embed.style.width = "100%";
            embed.style.height = "100%";
            myWindow = window.open('', '');
            myWindow.document.body.style.margin = 0;
            myWindow.document.body.appendChild(embed);
            myWindow.focus();
        }

            ctl.DocumentLoad = function () {
                var buibui = ctl.setMouseDragScrollMode(false) // 文档加载后设置控件的鼠标拖拽滚动模式
            }
            // 在服务器端响应控件的EventReadFileContent事件，即可使用AJAX模式加载文档。
            var bui = ctl.LoadDocumentFromFile(fileName, null)
            console.log(bui)

            </Element>
            <Element xsi:type="XString" StyleIndex="14">
               <InnerID>14201</InnerID>
               <Text>དུག་རིགས་ཀྱི་ལོ་རྒྱུས།</Text>

               <Text> གསོ་བྱར་ཟས་དུག གྱུར་དུག སྦྱར་དུག་དང་། དངོས་དུག་སོགས་ཕོག་པའི་གནས་ཚུལ་མེད།</Text>

            <Element xsi:type="XParagraphFlag" StyleIndex="24">
               <InnerID>143</InnerID>
            </Element>
            <Element xsi:type="XString" StyleIndex="14">
               <InnerID>14203</InnerID>
               <Text>བལྟ་རེག་བརྟག་ཐབས།</Text>
            </Element>
            <Element xsi:type="XString" StyleIndex="5">
               <InnerID>14204</InnerID>
               <Text> ལུས་དྲོད་ཏུའུ་༣༦.༦དབུགས་གྲངས་སྐར་རེར་ཐེངས༡༦ལེན། རྩའི་འཕར་གྲངས་སྐར་རེར་ཐེངས་༦༦འཕར། ཁྲག་ཤེད་འཁུམ་འདུའི་ཤུགས་༨༠དང་རྐྱོང་འབྱེད་ཤུགས་༦༠ཡིན། ལུས་ལྗིད་ཚད་སྤྱི་རྒྱ་༤༣ཤེས་བ་གསལ། སྨྲ་བརྗོད་དག གཞོགས་འདེགས་བརྟག་དཔྱད་ལ་རམ་འདེགས་བྱེད་ནུས། ལུས་བོངས་དང་ཉམས་སྟོབས་འབྲིང་། དབང་ལྔའི་ཆགས་དབྱིབས་དང་བྱེད་ལས་རྒྱུན་ལྡན། བད་རླུང་རང་བཞིན་ཅན། འཚོ་བཅུད་ལེགས། པགས་མདོག་སྐྱ་ལ་ལྡེམ་ཤུགས་ལེགས། རེག་བྱ་འཇམ་ཞིང་སྨུག་ཐིག་དང་རྣག་སྐྲངས་སོགས་མེད། ལུས་ཕྱི་ངོས་ཀྱི་རྨེན་བུ་ཁག་འབུར་ཁྲོས་སུ་གྱུར་མེད། བྱང་ཁོག་སྟོད་སྨད་ཁོད་སྙོམས། འབྲུམ་བུ་དང་རྩ་བཀྲ་མི་རིག བཤང་གཅིག་གཉིས་རྒྱུན་ལྡན། གཞང་མཚན་ལ་བརྟག་མེད།</Text>

   <BodyText>ཐེམ་ཆེན་རྫོང་བོད་ལུགས་སྨན་ཁང་།
 ནད་ཐོའི་འབྲི་ཤོག་ཐོག་མ།
ནད་ཁྲིའི་ཨང་།      ༡༣          ཚན་ཁག   ཕྱོགས་བསྡུས་ཁོང་ནད་།                ནད་སྡོད་ཨང་། ༡༥༠༠༠༡༩


རུས་མིང་། ཀླུ་མཚོ་སྐྱིད།                             རྟེན།  མོ།                        ལོ་གྲངས། ༤༣        
མི་རིགས།   བོད་རིགས།                                      ལས་བྱ།  ཕྱུགས་ལས།                            གཉེན་སྒྲིག   བྱས་ཟིན།      
ཕ་ཡུལ།   མཚོ་སྔོན་ཞིང་ཆེན།                                  སྡོད་གནས།   ཐེམ་ཆེན་རྫོང་ཅོང་ཆུ་གྲོང་བརྡལ་ཧྲེ་ལྔ་བ།
